import React from 'react'
import Style from './fotterComp.module.css'

const footerComponents = (props) => {
  return (
    <div>
      <span className={Style.span}>{props.title}</span>
      <ul>
        {props.list.map((item) => {
          return <li className={Style.li}>{item}</li>
        })}
      </ul>
    </div>
  )
}

export default footerComponents
